import React, { Component } from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap'

class header extends Component {
  render() {
    return (
      <div className="header-nav">
        <Navbar bg="dark" variant="dark" expand="md">
        <Container>
          <Navbar.Brand href="#home">Randy Meneses</Navbar.Brand>
          <Navbar.Toggle aria-controls="navbar-nav" />
          <Navbar.Collapse id="navbar-nav">
            <Nav className="mr-auto">
                  <Nav.Link className="nav-link-style" href="#aboutMe">About Me</Nav.Link>
                  <Nav.Link className="nav-link-style" href="#Projects">Projects</Nav.Link>
              </Nav>
              <Nav  >
                  <Nav.Link className="nav-link-style" href="#Contact-Me">Contact Me</Nav.Link>
                  <Nav.Link className="nav-link-style" href="#Resume">Resume</Nav.Link>            
              </Nav>
          </Navbar.Collapse>
          </Container>
        </Navbar>
    </div>
    );
  }
}

export default header;
